// Custom libs
import Header from '../components/header';
import Footer from '../components/footer';

// Home page definition
const IndexPage = () => {
  const alertHandler = () => {
    alert('ok makey');
  };

  return (
    <div>
      <Header />
      <h1>Hello world</h1>
      <button onClick={() => alertHandler()}>Alerta</button>
      <Footer />
    </div>
  );
};

export default IndexPage;
